import CardTask from "../cardTask";
import { StyleCard } from "./styles";

const HabitsBoard = () => {
  return (
    <div>
      <StyleCard>
        <h1>Meus Habitos</h1>
        <Button />
        <CardTask />
        <CardTask />
        <CardTask />
        <CardTask />
      </StyleCard>
    </div>
  );
};

export default HabitsBoard;
